import {useState, useEffect} from 'react';

import classes from './TestSite.module.css';

import TestStartInfoPage from './TestStartInfoPage';
import {getoneexamdetail} from '../CommonApps/AllAPICalls';



import ReadingTest from './ReadingTest';
import ListeningTest from './ListeningTest';
import WritingTest from './WritingTest';
import SpeakingTest from './SpeakingTest';


const TestHomePage=(props)=>{



   const [displayPage, setDisplayPage]=useState(0);   
   const [oneExamData, getOneExamData] = useState(null);

   const nextPageHandler=()=>{

     setDisplayPage(displayPage=>displayPage+1);

   }


   useEffect(()=>{

      let examId=props.examId;
      getoneexamdetail({examId, getOneExamData});

   },[]);




  console.log("oneExamData: ", oneExamData);





return <div className={classes.testHomePage}>


          { displayPage ===0 &&
          <TestStartInfoPage  next={nextPageHandler}/>
          }


          { displayPage ===1 && oneExamData !==null &&  

            <ReadingTest oneExamData={oneExamData} 
		         next={nextPageHandler}
		         responseId={props.responseId}
			 />

	  }


          { displayPage ===2 && oneExamData !==null &&

            <ListeningTest oneExamData={oneExamData} 
		           next={nextPageHandler}
		           responseId={props.responseId}
			   />

	  }


          { displayPage ===3 && oneExamData !==null &&

            <WritingTest oneExamData={oneExamData} 
		         next={nextPageHandler}
		         responseId={props.responseId}
			 />

          }


	  { displayPage ===4 && oneExamData !==null &&

            <SpeakingTest oneExamData={oneExamData} 
		          next={nextPageHandler}
		          responseId={props.responseId}
			  />

          }


          { displayPage ===5 && oneExamData !==null &&

          <div className={classes.testCompletePage}>  
			  <h1>Congrats!! Test Completed!</h1> 
			  <h3> Please contact the examiner for results. If you have designed this test, look at your response section of this exam to view your results</h3>
	  </div>

	  }		  


     </div>

}

export default TestHomePage;
